import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import TruckCard from "./TruckCard";

const cardBlockStyle = {
    display: 'inline-table',
    justifyContent: 'center'
}

const TableBlockStyle = {
    margin: '20px 18%',
}

function TruckTable() {
    const list = []

    for (let i = 0; i < 8; i++) {
        list.push(<div style={cardBlockStyle}><TruckCard/></div>)
    }
    return (
        <>
            <div className="card-group" style={TableBlockStyle}>

                <h2>Свободные грузовики</h2>
                {list}
            </div>
        </>
    );
}

export default TruckTable;
